import React from "react";
import Clock from "./Clock/Clock";

class Progress extends React.Component{

} (props) => {
    return (
        <div>
            <h1>
                Your progress:
            </h1>
            <Clock clockData={props.progressData}/>
        </div>
    )
};

export default Progress;
